import React from 'react'
import Base from '../components/Base';
import ContactUsForm from '../components/ContactUsForm';

const ContactUs=()=> {
  return (
    <div className='overflow-hidden'>
        <Base/>
        <ContactUsForm/>
    </div>
  )
}

export default ContactUs;
